import { StyleSheet, Text, View } from 'react-native';

export default function Heading({children, level}) {
  return (
    <View style={styles.container}>
      <Text>Update!</Text>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
